window.bookSummaryJSON = "<p>Young, dumb, and broke.&nbsp;&nbsp;</p> <p>That's what started everything. With five dollars in her pocket, and everything she owns stuffed in the back of her car, Lilith Goode's life is over. Done. Destroyed.&nbsp;&nbsp;</p> <p>Ten words. One text. That's what it took to change the whole world.&nbsp;&nbsp;</p> <p>A crumpled concert ticket. A chance encounter. That's what it takes to start all over again.&nbsp;&nbsp;</p> <p>Five rockstars. One girl. Six dark hearts, six withered souls.&nbsp;&nbsp;</p> <p>But can one broken person really put another back together again?&nbsp;&nbsp;</p> <p>And is a cross-country tour the place to do it?&nbsp;&nbsp;</p> <p>Contains mature themes.</p>"; 
